import React, {Component} from 'react';
import './list.css';
import Item from './item';

class List extends Component {

  constructor(props) {
    super(props);
    this.state = {
      itemList: []
    }
    var tempMask = {img: 'Img', price: '1000', name: 'temp'};
  }

  handleItem (maskInfo) {
    // parameter is sent by backend
    /* 
      it is dictionary which contains
      maskInfo.price, maskInfo.img, maskInfo.name
    */
    var temp = [];
    temp = this.state.itemList.copyWithin(); 
    temp.push(<Item maskInfo = {maskInfo}/>);
    this.setState({
      itemList: this.state.itemList
    })
  }

  render() {
    return (
      <div className = 'main-board'>
        {this.state.itemList}
      </div>
    );
  }
}

export default List
